import React, {useState} from "react";
import { useHttp } from "../hooks/http.hook";

export const MainPage = () =>{
    const {request} = useHttp();

    const [form, setId] = useState({id: ''})

    const getId = event => {
        setId({...form, [event.target.name]: event.target.value})
    }

    const getData = async () => {
        try
        {
            const data = await request('/api', 'POST', {...form});
            console.log('Data', data);
        }
        catch(error){}
    }

    return(
        <div>
            <h1>MainPage</h1>
            <input type = 'text' value='101' name ='id' onChange={getId}/>
            <input type='button' value='101' name ='id' data='101' onClick = {getData}/>
        </div>
    )
}
